q($,"aBW","an8",()=>A.d5("Berbagi Ta'jil Hari Jum'at","assets/img/infaq/jumat.jpg","Kegiatan berbagi takjil dihari Jumat berkah dengan bersedekah Rp.10.000 untuk 250 anak Yatim\nSedekah bagian identitas orang yang beriman dan melatih seseorang untuk melihat keadaan sekitar, bahwa hidup didunia harus saling mengasihi dan membantu satu sama lain.","/tajil-jumat",null))
q($,"aBX","an9",()=>A.d5("Buka Bersama Yatim & Dhu'afa","assets/img/pembinaan/yatimTajil.jpeg","Pada saat bulan Ramadhan banyak orang yang berlomba-lomba dalam kebaikan. Salah satu kegiatan yang umum adalah dengan mengadakan buka puasa bersama 300 anak yatim @Rp 10.000;/paket. Meskipun tampak sederhana, nyatanya kegiatan ini memiliki banyak manfaat. ","/tajil-yatim",1e4))
